import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import { MenuItems } from "./functionNAVIGATION";
import './null.scss';
import './sidebarMenu.scss';

export const SidebarMenu = () => {
   const menuSidebar = [
      { value: "Бестселлеры", url: '#' , element: "bestsellers"},
      { value: "Новинки", url: '#', element: "nems" },
      { value: "Нехудожественная литература", url: '#', element: "non-fiction" },
      { value: "Художественная литература", url: '#', element: "fiction" },
      { value: "Детская литература", url: '#', element: "literature for children" },
      { value: "Бизнесс литература", url: '#', element: "business literature" },
      { value: "Учебная литература", url: '#', element: "education literature" },
      { value: "Психология", url: '#', element: "psychology" },
      { value: "Комиксы и манга", url: '#', element: "comics and Manga" },
      { value: "Изучение иностранных языков", url: '#' , element: "learning foreign languages"},
      { value: "Медицина", url: '#', element: "medicine" },
      { value: "Кулинария и напитки", url: '#' , element: "cooking & Drink" },
      { value: "Красота, здоровья, спорт", url: '#' , element: "beauty, health, sports" },
      { value: "Компьютеры и интернет", url: '#' , element: "computers and the Internet" },

   ];


   return (
      
      <>
      <Routes>
          {
              menuSidebar.map((nav) => {
                  return (
                      <Route key={nav.length()} path={nav.url} element={nav.element}/>
                  );
              })
          }
      </Routes>

      <div >
          <ErrorBounde>
              < MenuItems props={menuSidebar}/>
          </ErrorBounde>
      </div>
  </>
      
      
       
    
   )
}
